import React from 'react';

const VideoSection = () => {
  return (
    
    <section className="container mx-auto my-8 text-center">
      <h3 className="text-xl font-bold mb-4">Post Your Requirements</h3>
      <iframe
        width="560"
        height="315"
        src="https://www.youtube.com/embed/dQw4w9WgXcQ"
        title="YouTube video"
        className="mx-auto"
        allowFullScreen
      ></iframe>
    </section>
  );
};

export default VideoSection;
